import './styles.css';

const Banner =() => (
    <banner className="banner">
        <p>Sizin için en güncell blog yazılarını hazırlıyoruz</p>
        <div className="banner-image">
            <img src="assets/images/banner.jpg" alt="" />
        </div>
    </banner>
)

export default Banner;
